import React from 'react'
import { MDBCol, MDBContainer, MDBFormInline, MDBIcon, MDBRow } from "mdbreact";

function Searchbar() {
    return (
        <MDBContainer>
            <MDBRow>
                <MDBCol><MDBIcon icon="search"/>
            </MDBCol>
            </MDBRow>
        </MDBContainer>
    )
}

export default Searchbar
